import React from "react";
import "./home.css";

import HeaderHome from "./headerHome/HeaderHome";

function HasNoCollection({ collections }) {
  console.log(collections.data);
  return (
    <div className="HasNoCollection">
      <div className="content">
        <div className="title">You have no collections.</div>

        <div className="collections">
          {collections &&
            collections.map((collection) => {
              console.log(collection);
            })}
          <button className="addCollection button btn--border btn--hover-bg-gray">
            Add Your First Collection
          </button>
        </div>
      </div>
    </div>
  );
}

export default function Home() {
  const listCollections = ["BMW", "Mercs", "Honda"];
  return (
    <div className="Home">
      <HeaderHome />
      <div className="content">
        {console.log(listCollections)}

        <HasNoCollection data={listCollections} />
      </div>
    </div>
  );
}
